def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> Tuple[List[Block], Index]:
    aggregated_blocks = []
    aggregated_items = []

    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    for block in data.blocks:
        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
        except NotImplementedError:
            if alt is None:
                raise NotImplementedError(
                    "The operation in an alternate way is not supported."
                )
            obj = self.obj[data.items[block.mgr_locs.as_array]]
            if obj.shape[1] == 1:
                obj = obj.iloc[:, 0]
            s = get_groupby(obj, self.grouper)
            result = s.aggregate(lambda x: alt(x, axis=self.axis))
            result = cast(DataFrame, result)

        dtype = maybe_downcast_to_dtype(block.dtype)
        agg_block: Block = make_block(result, placement=block.mgr_locs, dtype=dtype)
        aggregated_blocks.append(agg_block)

    for block in aggregated_blocks:
        aggregated_items.extend(block.mgr_locs)

    agg_items = data.items.take(np.unique(aggregated_items))

    return aggregated_blocks, agg_items
